Text:
Thanks Extremezone for a wonderful upload

@aryadev, @MrStillwell

Very good movie. All events are historical from WW2. Actual life in Europe under German and Soviet occupation was much more dramatic and tragic than all Hollywood film scenarios together. No propaganda of any sort in this particular film. "No Way Back" is the best war movie made so far. Read memoirs of former prisoners of German and Soviet death camps from WW2 and you will know what is a propaganda and what is the truth.
